def numIslands(grid):
    """
    :type grid: List[List[str]]
    :rtype: int
    """
    ROWS,COLS= len(grid),len(grid[0])
    visit= set()
    islands=0
    
    def dfs(r,c):
        if (r<0 or c<0 or r>=ROWS or c>=COLS or
            grid[r][c]!='1' or (r,c) in visit):
            return
        visit.add((r,c))
        dfs(r+1,c)
        dfs(r-1,c)
        dfs(r,c+1)
        dfs(r,c-1)
    
    for r in range(ROWS):
        for c in range(COLS):
            if (r,c) not in visit and grid[r][c]=='1':
                islands+=1
                dfs(r,c)
    return islands